INSERT INTO `unit_data` VALUES (/*unit_id*/100101, /*unit_name*/"ヒヨリ", /*kana*/"ひより", /*prefab_id*/100101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/200, /*atk_type*/1, /*normal_atk_cast_time*/2.295, /*cutin_1*/100101, /*cutin_2*/0, /*cutin1_star6*/100101, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】前衛で、敵前線を押し返す笑顔の元気娘。\n前衛に対して大ダメージを与えるユニオンバーストと、\n自身の攻撃力を強化するスキルを持つ攻撃役。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/100201, /*unit_name*/"ユイ", /*kana*/"ゆい", /*prefab_id*/100201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/800, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/100201, /*cutin_2*/0, /*cutin1_star6*/100201, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【魔法】最後衛から、味方の回復と補助を行う魔法士。\n打たれ弱いが高い魔法攻撃力を持ち、ランクを上げると\n攻撃も補助もバランスよくこなせるようになる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/100301, /*unit_name*/"レイ", /*kana*/"れい", /*prefab_id*/100301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/250, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/100301, /*cutin_2*/0, /*cutin1_star6*/100301, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】前衛で、一点突破で敵を討つ、孤高の剣士。\nユニオンバースト、スキル共に眼前の敵を倒す事に優れ、\n攻撃スキルやカウンターを駆使して前線を押し上げる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/100401, /*unit_name*/"ミソギ", /*kana*/"みそぎ", /*prefab_id*/100401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/205, /*atk_type*/1, /*normal_atk_cast_time*/2.17, /*cutin_1*/100401, /*cutin_2*/0, /*cutin1_star6*/100401, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】最前衛で、敵の物理攻撃を邪魔するいたずら娘。\n目の前の敵を暗闇状態にし、命中率を大幅に下げるほか、\n敵一体の物理攻撃力を下げるスキルを持つ。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/100501, /*unit_name*/"マツリ", /*kana*/"まつり", /*prefab_id*/100501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/185, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/100501, /*cutin_2*/0, /*cutin1_star6*/100501, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛の、機敏な動きで敵をかき回す騎士見習い。\nユニオンバーストで相手の陣地の真ん中に飛び込み、\n自分の周囲を攻撃するスキルで相手を攻め立てる。", /*only_disp_owned*/0, /*start_time*/"2018/09/18 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/100601, /*unit_name*/"アカリ", /*kana*/"あかり", /*prefab_id*/100601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/570, /*atk_type*/2, /*normal_atk_cast_time*/2.19, /*cutin_1*/100601, /*cutin_2*/0, /*cutin1_star6*/100601, /*cutin2_star6*/0, /*guild_id*/14, /*exskill_display*/0, /*comment*/"【魔法】中衛で、魔法パーティの強化を担う、双子の妹。\n敵の魔法防御力を大幅に下げるスキルや、魔法攻撃力を\n上昇させ、回復効果を付与するユニオンバーストを使う。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/100701, /*unit_name*/"ミヤコ", /*kana*/"みやこ", /*prefab_id*/100701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/125, /*atk_type*/1, /*normal_atk_cast_time*/1.7, /*cutin_1*/100701, /*cutin_2*/0, /*cutin1_star6*/100701, /*cutin2_star6*/0, /*guild_id*/14, /*exskill_display*/0, /*comment*/"【物理】最前衛で、ひたすら敵の攻撃を避ける幽霊少女。\nスキルで幽霊に変身することで敵の攻撃を躱し、\nユニオンバーストでは敵をプリンにして食べてしまう。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/100801, /*unit_name*/"ユキ", /*kana*/"ゆき", /*prefab_id*/100801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/805, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/100801, /*cutin_2*/0, /*cutin1_star6*/100801, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【魔法】後衛で物理パーティを補助する、歩く芸術作品。\n味方のユニオンバースト発動を早めるスキルのほか、\n暗闇状態にするスキルで敵の物理攻撃を封じる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/100901, /*unit_name*/"アンナ", /*kana*/"あんな", /*prefab_id*/100901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/440, /*atk_type*/2, /*normal_atk_cast_time*/2.25, /*cutin_1*/100901, /*cutin_2*/0, /*cutin1_star6*/100901, /*cutin2_star6*/0, /*guild_id*/11, /*exskill_display*/0, /*comment*/"【魔法】中衛から圧倒的な魔力で攻撃する、疾風の冥姫。\nユニオンバーストで敵全体に大ダメージを与えるが、\n高すぎる魔力の為、自分自身にも相応のリスクが生じる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/101001, /*unit_name*/"マホ", /*kana*/"まほ", /*prefab_id*/101001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/795, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/101001, /*cutin_2*/0, /*cutin1_star6*/101001, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【魔法】後衛で味方のサポートを担当するメルヘン少女。\n味方全体を強化してＴＰを回復するユニオンバーストや、\nＨＰ回復、敵を暗闇にするスキルで戦況を好転させる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/101101, /*unit_name*/"リノ", /*kana*/"りの", /*prefab_id*/101101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/700, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/101101, /*cutin_2*/0, /*cutin1_star6*/101101, /*cutin2_star6*/0, /*guild_id*/6, /*exskill_display*/0, /*comment*/"【物理】後衛から、矢の雨を降らせる妹系アーチャー。\nクリティカル率を高める重ね掛け可能なスキルを持ち、\nダメージ回数の多いユニオンバーストをより強力にする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/101201, /*unit_name*/"ハツネ", /*kana*/"はつね", /*prefab_id*/101201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/755, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/101201, /*cutin_2*/0, /*cutin1_star6*/101201, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛の、対物理パーティが得意な超能力ガール。\nスキルが物理攻撃の敵に対して真価を発揮するため、\n物理攻撃型の敵パーティを一網打尽にする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/101301, /*unit_name*/"ナナカ", /*kana*/"ななか", /*prefab_id*/101301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/740, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/101301, /*cutin_2*/0, /*cutin1_star6*/101301, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛から多彩な魔法を放つ、オタク魔法少女。\n体力が一番多い相手を狙うユニオンバーストやスキルは、\n敵のＨＰ状況により攻撃対象が変わる高威力の魔法攻撃。", /*only_disp_owned*/0, /*start_time*/"2018/11/19 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/101401, /*unit_name*/"カスミ", /*kana*/"かすみ", /*prefab_id*/101401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/730, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/101401, /*cutin_2*/0, /*cutin1_star6*/101401, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛で、相手の行動妨害に特化した名探偵。\n束縛や混乱を付与するスキルで相手の行動を妨害し、\n魔法防御力ダウンのフィールドを展開して王手をかける。", /*only_disp_owned*/0, /*start_time*/"2019/02/28 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
