INSERT INTO `unit_data` VALUES (/*unit_id*/101601, /*unit_name*/"スズナ", /*kana*/"すずな", /*prefab_id*/101601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/705, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/101601, /*cutin_2*/0, /*cutin1_star6*/101601, /*cutin2_star6*/0, /*guild_id*/15, /*exskill_display*/0, /*comment*/"【物理】後衛からクリティカル攻撃するカリスマモデル。\nダメージ2倍のクリティカルダメージは\nスキルによる攻撃力アップでさらに破壊力を増す。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
