INSERT INTO `unit_data` VALUES (/*unit_id*/102001, /*unit_name*/"ミミ", /*kana*/"みみ", /*prefab_id*/102001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/360, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/102001, /*cutin_2*/0, /*cutin1_star6*/102001, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】中衛で、敵前衛を崩す、うさぎっこ。\nユニオンバーストは、最も近い敵に大ダメージを与えた後\n隣の敵にも攻撃するので、前衛を早期に攻め落とせる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/102101, /*unit_name*/"クルミ", /*kana*/"くるみ", /*prefab_id*/102101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/240, /*atk_type*/1, /*normal_atk_cast_time*/1.675, /*cutin_1*/102101, /*cutin_2*/0, /*cutin1_star6*/102101, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】前衛で、味方の守りに特化した、極度の照れ屋。\nスキルで自分の周囲の物理、魔法防御力を上げつつ、\n近くの敵をスタンさせて足止めする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/102201, /*unit_name*/"ヨリ", /*kana*/"より", /*prefab_id*/102201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/575, /*atk_type*/2, /*normal_atk_cast_time*/2.19, /*cutin_1*/102201, /*cutin_2*/0, /*cutin1_star6*/102201, /*cutin2_star6*/0, /*guild_id*/14, /*exskill_display*/0, /*comment*/"【魔法】中衛から、強力な魔法で攻め立てる、双子の姉。\n自身のＨＰと引き換えに魔法攻撃力を増幅し、\nユニオンバーストやスキルの威力を高めて攻撃する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/102301, /*unit_name*/"アヤネ", /*kana*/"あやね", /*prefab_id*/102301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/210, /*atk_type*/1, /*normal_atk_cast_time*/1.425, /*cutin_1*/102301, /*cutin_2*/0, /*cutin1_star6*/102301, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】前衛で、戦場をかき乱す、くまっ子。\nユニオンバーストで、相手を思い切り吹き飛ばすと同時に\nスタンと大ダメージを与えることで敵陣形を大きく乱す。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/102501, /*unit_name*/"スズメ", /*kana*/"すずめ", /*prefab_id*/102501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/720, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/102501, /*cutin_2*/0, /*cutin1_star6*/102501, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【魔法】後衛で、回復と攻撃をこなすドジっ娘メイド。\n周りの味方のＨＰを回復しつつ物理攻撃力を高める\nスキルは、中衛・後衛の攻撃役と抜群の相性。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/102601, /*unit_name*/"リン", /*kana*/"りん", /*prefab_id*/102601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/550, /*atk_type*/1, /*normal_atk_cast_time*/2.34, /*cutin_1*/102601, /*cutin_2*/0, /*cutin1_star6*/102601, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】中衛で物理パーティを強化するものぐさ少女。\n味方の物理攻撃力をアップしつつ、味方の魔法防御を\n高めることで攻守ともにパーティをサポートする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/102701, /*unit_name*/"エリコ", /*kana*/"えりこ", /*prefab_id*/102701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/230, /*atk_type*/1, /*normal_atk_cast_time*/1.425, /*cutin_1*/102701, /*cutin_2*/0, /*cutin1_star6*/102701, /*cutin2_star6*/0, /*guild_id*/11, /*exskill_display*/0, /*comment*/"【物理】前衛で、毒スキルで敵を粉砕する、通称壊し屋。\n最高クラスの攻撃力を持ち、ユニオンバーストで\n敵にとどめを刺す毎に、その攻撃力はさらにアップする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/102801, /*unit_name*/"サレン", /*kana*/"されん", /*prefab_id*/102801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/430, /*atk_type*/1, /*normal_atk_cast_time*/2.09, /*cutin_1*/102801, /*cutin_2*/0, /*cutin1_star6*/102801, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】中衛で一発逆転を狙う、みんなのサレンママ。\nＨＰが下がるほどダメージが上昇するユニオンバーストと\n味方のＴＰを回復するスキルで、一気に形勢を逆転する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/102901, /*unit_name*/"ノゾミ", /*kana*/"のぞみ", /*prefab_id*/102901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/160, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/102901, /*cutin_2*/0, /*cutin1_star6*/102901, /*cutin2_star6*/0, /*guild_id*/10, /*exskill_display*/0, /*comment*/"【物理】前衛で、皆の壁になって戦うアイドルのぞみん。\n彼女がステージに立てば、味方の物理攻撃力が\n大きくアップし、さらに敵の注意を一手に惹き付ける。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/103001, /*unit_name*/"ニノン", /*kana*/"にのん", /*prefab_id*/103001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/415, /*atk_type*/1, /*normal_atk_cast_time*/2.25, /*cutin_1*/103001, /*cutin_2*/0, /*cutin1_star6*/103001, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】中衛で、強力な範囲攻撃を操る、忍術の使い手。\n範囲攻撃のスキルで敵を倒す事で、自分のＴＰを回復し、\n強力なユニオンバーストの発動頻度を上げる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/103101, /*unit_name*/"シノブ", /*kana*/"しのぶ", /*prefab_id*/103101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/365, /*atk_type*/1, /*normal_atk_cast_time*/2.25, /*cutin_1*/103101, /*cutin_2*/0, /*cutin1_star6*/103101, /*cutin2_star6*/0, /*guild_id*/14, /*exskill_display*/0, /*comment*/"【物理】中衛で、父親のドクロを召喚して戦う霊能少女。\n召喚した父親は、自分とは別に攻撃を行ってくれるほか、\nダメージを代わりに受けてくれることもある。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/103201, /*unit_name*/"アキノ", /*kana*/"あきの", /*prefab_id*/103201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/180, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/103201, /*cutin_2*/0, /*cutin1_star6*/103201, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】前衛で大暴れして攻める、令嬢剣士。\n自分の周りに、味方を回復するフィールドを作り出し、\n自ら前線を支え導く姿も、名家を背負う者のあるべき姿。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/103301, /*unit_name*/"マヒル", /*kana*/"まひる", /*prefab_id*/103301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/395, /*atk_type*/1, /*normal_atk_cast_time*/2.34, /*cutin_1*/103301, /*cutin_2*/0, /*cutin1_star6*/103301, /*cutin2_star6*/0, /*guild_id*/5, /*exskill_display*/0, /*comment*/"【物理】中衛で、相手の動きを乱す牧場主。\n敵前衛をノックバックさせることで、隊列を崩し、\n他のキャラが使う範囲攻撃の対象に敵を押し込む。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/103401, /*unit_name*/"ユカリ", /*kana*/"ゆかり", /*prefab_id*/103401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/405, /*atk_type*/1, /*normal_atk_cast_time*/2.4, /*cutin_1*/103401, /*cutin_2*/0, /*cutin1_star6*/103401, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】中衛から、バリアや回復で味方を守る元聖騎士。\n傷ついた味方のＨＰやＴＰを回復するスキルを操り、\n打ち合いで消耗した所を、ピンポイントでサポートする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/103601, /*unit_name*/"キョウカ", /*kana*/"きょうか", /*prefab_id*/103601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/810, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/103601, /*cutin_2*/0, /*cutin1_star6*/103601, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛から強力な魔法で攻撃するちびっこ優等生。\nスキルで魔法攻撃力を瞬間的に高めた後に放つ\nユニオンバーストは敵単体への威力抜群。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/103701, /*unit_name*/"トモ", /*kana*/"とも", /*prefab_id*/103701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/220, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/103701, /*cutin_2*/0, /*cutin1_star6*/103701, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で、素早い斬撃を仕掛け敵を屠る剣術少女。\nユニオンバーストで自分の攻撃力と行動速度を上昇させ、\nほか攻撃スキルの殲滅能力を極限まで高め敵を圧倒する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/103801, /*unit_name*/"シオリ", /*kana*/"しおり", /*prefab_id*/103801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/710, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/103801, /*cutin_2*/0, /*cutin1_star6*/103801, /*cutin2_star6*/0, /*guild_id*/5, /*exskill_display*/0, /*comment*/"【物理】最後衛から高火力スキルを連発するスナイパー。\nダメージを与えつつ、ＴＰを回復するスキルを持ち、\n強力な一撃のユニオンバーストを、素早く発動する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/104001, /*unit_name*/"アオイ", /*kana*/"あおい", /*prefab_id*/104001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/785, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/104001, /*cutin_2*/0, /*cutin1_star6*/104001, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【物理】最後衛から状態異常の矢を放つ、ぼっちの射手。\nダメージと共に付与する毒や麻痺の追加効果により、\n防御力の高い敵であっても、確実にＨＰを削りとる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/104201, /*unit_name*/"チカ", /*kana*/"ちか", /*prefab_id*/104201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/790, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/104201, /*cutin_2*/0, /*cutin1_star6*/104201, /*cutin2_star6*/0, /*guild_id*/10, /*exskill_display*/0, /*comment*/"【魔法】後衛から、前衛の戦いをサポートする唱喚士。\nユニオンバーストで、味方の回復と敵への攻撃を行う\n精霊を最前線に唱喚する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/104301, /*unit_name*/"マコト", /*kana*/"まこと", /*prefab_id*/104301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/165, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/104301, /*cutin_2*/0, /*cutin1_star6*/104301, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】前衛で、敵の防御力を削り取る、正義の獣人。\n敵の盾役の防御力を下げ、着実にダメージを与えることで\n早期に敵の守りを突破する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/104401, /*unit_name*/"イリヤ", /*kana*/"いりや", /*prefab_id*/104401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/425, /*atk_type*/2, /*normal_atk_cast_time*/1.425, /*cutin_1*/104401, /*cutin_2*/0, /*cutin1_star6*/104401, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【魔法】中衛で命を削り攻撃する「夜を統べる者」。\n自身のＨＰと引き換えに放つスキルは高い殲滅力を誇り\n範囲攻撃における威力では他の追随を許さない。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/104501, /*unit_name*/"クウカ", /*kana*/"くうか", /*prefab_id*/104501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/130, /*atk_type*/1, /*normal_atk_cast_time*/2.375, /*cutin_1*/104501, /*cutin_2*/0, /*cutin1_star6*/104501, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】前衛で囮となり、攻撃を引き付ける暴走ドＭ娘。\nユニオンバーストにより、自身に魔法バリアを張り、\n敵の魔法攻撃を吸収してＨＰを回復する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/104601, /*unit_name*/"タマキ", /*kana*/"たまき", /*prefab_id*/104601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/215, /*atk_type*/1, /*normal_atk_cast_time*/2.25, /*cutin_1*/104601, /*cutin_2*/0, /*cutin1_star6*/104601, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】前衛の、対魔法パーティが得意な気まぐれ猫娘。\n攻撃スキルは、「魔法攻撃力が一番高い敵」を狙い撃ち、\nダメージ、魔法攻撃力ダウン、ＴＰ吸収と畳み掛ける。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/104701, /*unit_name*/"ジュン", /*kana*/"じゅん", /*prefab_id*/104701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/135, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/104701, /*cutin_2*/0, /*cutin1_star6*/104701, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】最前衛で、完全防御スキルを操る騎士団長。\nユニオンバーストであらゆるダメージを吸収するバリアを\n展開できる。特に長期戦で圧倒的な防御性能を誇る。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/104801, /*unit_name*/"ミフユ", /*kana*/"みふゆ", /*prefab_id*/104801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/420, /*atk_type*/1, /*normal_atk_cast_time*/2.19, /*cutin_1*/104801, /*cutin_2*/0, /*cutin1_star6*/104801, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】中衛の、スタンと回復のスキルを持つ傭兵戦士。\n高い防御力と自己回復能力を併せ持つ事で、\n中衛の守りを堅固にし、パーティを底支えする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/104901, /*unit_name*/"シズル", /*kana*/"しずる", /*prefab_id*/104901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/285, /*atk_type*/1, /*normal_atk_cast_time*/2.375, /*cutin_1*/104901, /*cutin_2*/0, /*cutin1_star6*/104901, /*cutin2_star6*/0, /*guild_id*/6, /*exskill_display*/0, /*comment*/"【物理】前衛で、物理攻撃から味方を守る、お姉ちゃん。\nスキルで物理無効バリアを展開し、味方全員を守るほか、\n自身はさらに物理吸収バリアを纏い、敵前衛を討つ。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/105001, /*unit_name*/"ミサキ", /*kana*/"みさき", /*prefab_id*/105001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/760, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/105001, /*cutin_2*/0, /*cutin1_star6*/105001, /*cutin2_star6*/0, /*guild_id*/15, /*exskill_display*/0, /*comment*/"【魔法】後衛から、範囲攻撃を行う、レディ・ウィッチ。\n複数回の範囲攻撃を放つスキルや、目の前の敵全てを\n攻撃するユニオンバーストを持ち、範囲殲滅に特化する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/105101, /*unit_name*/"ミツキ", /*kana*/"みつき", /*prefab_id*/105101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/565, /*atk_type*/1, /*normal_atk_cast_time*/2.25, /*cutin_1*/105101, /*cutin_2*/0, /*cutin1_star6*/105101, /*cutin2_star6*/0, /*guild_id*/11, /*exskill_display*/0, /*comment*/"【物理】中衛で、敵弱体化フィールドを操る隻眼の悪魔。\nフィールドの持続時間は短いが、範囲内の敵の\n物理防御力を大幅に減らす効果を持つ。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/105201, /*unit_name*/"リマ", /*kana*/"りま", /*prefab_id*/105201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/105, /*atk_type*/1, /*normal_atk_cast_time*/2.215, /*cutin_1*/105201, /*cutin_2*/0, /*cutin1_star6*/105201, /*cutin2_star6*/0, /*guild_id*/5, /*exskill_display*/0, /*comment*/"【物理】最前衛で味方を守る、恋する乙女。\nバトル開始後、しばらくしてから最前線まで\n突進してきて、敵の目の前に立ちはだかる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/105301, /*unit_name*/"モニカ", /*kana*/"もにか", /*prefab_id*/105301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/410, /*atk_type*/1, /*normal_atk_cast_time*/2.24, /*cutin_1*/105301, /*cutin_2*/0, /*cutin1_star6*/105301, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】中衛で、味方の攻撃を鼓舞する、軍人娘。\n味方全体の物理、魔法攻撃力の大幅アップに加えて、\n攻撃速度もあげることで、戦闘の早期終結を実現する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/105401, /*unit_name*/"ツムギ", /*kana*/"つむぎ", /*prefab_id*/105401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/195, /*atk_type*/1, /*normal_atk_cast_time*/2.42, /*cutin_1*/105401, /*cutin_2*/0, /*cutin1_star6*/105401, /*cutin2_star6*/0, /*guild_id*/10, /*exskill_display*/0, /*comment*/"【物理】前衛で、敵の妨害に特化したテーラーガール。\n敵を強制的に移動させる事で陣形を崩し、さらに\n移動速度・行動速度を低下させ相手の反撃を遅らせる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/105501, /*unit_name*/"アユミ", /*kana*/"あゆみ", /*prefab_id*/105501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/510, /*atk_type*/1, /*normal_atk_cast_time*/2.34, /*cutin_1*/105501, /*cutin_2*/0, /*cutin1_star6*/105501, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】中衛で、どたばたと敵をかく乱する、純情少女。\n敵をスタンさせるスキルのほか、ユニオンバーストでは\n暗闇と混乱を付与することで敵を邪魔することができる。", /*only_disp_owned*/0, /*start_time*/"2019/03/19 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/105601, /*unit_name*/"ルカ", /*kana*/"るか", /*prefab_id*/105601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/158, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/105601, /*cutin_2*/0, /*cutin1_star6*/105601, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で味方のため剣を振るう、いなせな姉御。\n相手へのカウンターも行う挑発や、敵の防御力を下げる\nユニオンバーストを持ち、攻防両面で実力を発揮する。", /*only_disp_owned*/0, /*start_time*/"2018/11/03 19:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/105701, /*unit_name*/"ジータ", /*kana*/"じーた", /*prefab_id*/105701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/245, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/105701, /*cutin_2*/0, /*cutin1_star6*/170101, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/105801, /*unit_name*/"ペコリーヌ", /*kana*/"ぺこりーぬ", /*prefab_id*/105801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/155, /*atk_type*/1, /*normal_atk_cast_time*/2.25, /*cutin_1*/105801, /*cutin_2*/0, /*cutin1_star6*/105801, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】前衛にて、全力で仲間を護る、腹ペコ剣士。\n高いＨＰに加えて、自分自身でもＨＰ回復できるため\nギリギリまで味方の壁役を引き受ける。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/105901, /*unit_name*/"コッコロ", /*kana*/"こっころ", /*prefab_id*/105901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/500, /*atk_type*/1, /*normal_atk_cast_time*/2.34, /*cutin_1*/105901, /*cutin_2*/0, /*cutin1_star6*/105901, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】中衛で、補助と攻撃で皆を支える、導きの巫女。\nユニオンバーストは、味方全体の攻撃力アップに加えて\n自らも回復するため、継続的なサポートが可能となる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/106001, /*unit_name*/"キャル", /*kana*/"きゃる", /*prefab_id*/106001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/750, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/106001, /*cutin_2*/0, /*cutin1_star6*/106001, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】後衛から、強力な全体攻撃を放つ、強気な猫娘。\nスキルで敵の物理、魔法両方の防御力を下げるため\n編成を選ばずにバトルを有利に進められる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/106101, /*unit_name*/"ムイミ", /*kana*/"むいみ", /*prefab_id*/106101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/162, /*atk_type*/1, /*normal_atk_cast_time*/1.8, /*cutin_1*/106101, /*cutin_2*/0, /*cutin1_star6*/106101, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】前衛で、伝説の剣「天楼覇断剣」を振るう少女。\n小技を駆使する通常の戦闘スタイルから一転、ユニオン\nバースト後は「天楼覇断剣」を携え、敵を薙ぎ払う。", /*only_disp_owned*/0, /*start_time*/"2021/10/31 12:00:00", /*end_time*/"2021/11/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/106301, /*unit_name*/"アリサ", /*kana*/"ありさ", /*prefab_id*/106301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/625, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/106301, /*cutin_2*/0, /*cutin1_star6*/106301, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】後衛の、長期戦に優れた、森の守護者見習い。\nＴＰ回復によるユニオンバーストの速攻が可能。さらに\n使用後はスキル効果が上昇するため高い殲滅力を誇る。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/106401, /*unit_name*/"シェフィ", /*kana*/"しぇふぃ", /*prefab_id*/106401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/368, /*atk_type*/1, /*normal_atk_cast_time*/1.84, /*cutin_1*/106401, /*cutin_2*/0, /*cutin1_star6*/106401, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】中衛で氷雪を操り敵を凍滅する、氷竜の少女。\nユニオンバーストで獲得する【氷竜の印】を消費して、\nスキルの効果を増幅し、清廉な剣技で敵を切り伏せる。", /*only_disp_owned*/0, /*start_time*/"2021/02/15 23:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/106501, /*unit_name*/"カヤ", /*kana*/"かや", /*prefab_id*/106501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/168, /*atk_type*/1, /*normal_atk_cast_time*/2.17, /*cutin_1*/106501, /*cutin_2*/0, /*cutin1_star6*/106501, /*cutin2_star6*/0, /*guild_id*/17, /*exskill_display*/0, /*comment*/"【物理】前衛で、敵を殴り倒す喧嘩屋ドラゴン族。\nスキルで自身の物理攻撃力を高め、全身全霊を懸け放つ\n初弾のユニオンバーストは、超大な破壊力を誇る。", /*only_disp_owned*/0, /*start_time*/"2019/11/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/106601, /*unit_name*/"イノリ", /*kana*/"いのり", /*prefab_id*/106601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/197, /*atk_type*/1, /*normal_atk_cast_time*/1.55, /*cutin_1*/106601, /*cutin_2*/0, /*cutin1_star6*/106601, /*cutin2_star6*/0, /*guild_id*/17, /*exskill_display*/0, /*comment*/"【物理】前衛で範囲攻撃が得意な口達者のドラゴン娘。\nユニオンバーストで範囲内の敵をまとめて吹き飛ばし、\n陣形を乱したところで、敵を一気に焼き尽くす。", /*only_disp_owned*/0, /*start_time*/"2020/06/17 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/106701, /*unit_name*/"ホマレ", /*kana*/"ほまれ", /*prefab_id*/106701, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/21, /*se_type*/7, /*move_speed*/450, /*search_area_width*/727, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/106701, /*cutin_2*/0, /*cutin1_star6*/106701, /*cutin2_star6*/0, /*guild_id*/17, /*exskill_display*/0, /*comment*/"【魔法】後衛から無窮の魔力で全てを支配する龍の首領。\n障壁となる敵を龍眼で捉え、多彩な補助系スキルで敵の\n魔法攻撃からの耐性を弱め、雷霆の一撃で灰燼に帰す。", /*only_disp_owned*/0, /*start_time*/"2021/10/31 12:00:00", /*end_time*/"2021/11/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/106801, /*unit_name*/"ラビリスタ", /*kana*/"らびりすた", /*prefab_id*/106801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/560, /*atk_type*/1, /*normal_atk_cast_time*/1.55, /*cutin_1*/106801, /*cutin_2*/0, /*cutin1_star6*/106801, /*cutin2_star6*/0, /*guild_id*/6, /*exskill_display*/0, /*comment*/"【物理】中衛で、万有を自在に創造する『迷宮女王』。\n七冠としての権能を解放するユニオンバーストで自身を\n極大に強化し比類ない攻撃能力で仇なす者を剿滅する。", /*only_disp_owned*/0, /*start_time*/"2021/10/31 12:00:00", /*end_time*/"2021/11/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/107001, /*unit_name*/"ネネカ", /*kana*/"ねねか", /*prefab_id*/107001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/660, /*atk_type*/2, /*normal_atk_cast_time*/2.0, /*cutin_1*/107001, /*cutin_2*/0, /*cutin1_star6*/107001, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】後衛で、分身生成し敵を圧倒する『変貌大妃』。\n分身はネネカ自身と同じスキルをくり出し敵を攻撃する。\nその攻撃密度と制圧力の高さは他の追随を許さない。", /*only_disp_owned*/0, /*start_time*/"2021/10/31 12:00:00", /*end_time*/"2021/11/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/107101, /*unit_name*/"クリスティーナ", /*kana*/"くりすてぃーな", /*prefab_id*/107101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/10, /*se_type*/4, /*move_speed*/450, /*search_area_width*/290, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/107101, /*cutin_2*/0, /*cutin1_star6*/107101, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で、絶対的な制圧力を誇る『誓約女君』。\n攻防一体かつ超大な破壊力を誇るユニオンバーストと、\nその発動を加速するＴＰ上昇アップスキルを併せ持つ。", /*only_disp_owned*/0, /*start_time*/"2021/10/31 12:00:00", /*end_time*/"2021/11/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/107501, /*unit_name*/"ペコリーヌ（サマー）", /*kana*/"ぺこりーぬ", /*prefab_id*/107501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/235, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/107501, /*cutin_2*/0, /*cutin1_star6*/107501, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】前衛から強烈な範囲攻撃を放つ、渚のお姫様。\nかき氷を食べて物理攻撃力を一気に上昇させ、\nユニオンバーストを放つことで前方の敵を殲滅する。", /*only_disp_owned*/0, /*start_time*/"2021/06/20 15:00:00", /*end_time*/"2021/06/24 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/107601, /*unit_name*/"コッコロ（サマー）", /*kana*/"こっころ", /*prefab_id*/107601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/535, /*atk_type*/1, /*normal_atk_cast_time*/2.34, /*cutin_1*/107601, /*cutin_2*/0, /*cutin1_star6*/107601, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】中衛で、物理キャラの補助を行う癒しの巫女。\nＨＰが一番少ない味方単体への特大回復スキルを持ち、\n瀕死の味方ですら瞬時に治癒する。", /*only_disp_owned*/0, /*start_time*/"2020/06/19 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/107701, /*unit_name*/"スズメ（サマー）", /*kana*/"すずめ", /*prefab_id*/107701, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/775, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/107701, /*cutin_2*/0, /*cutin1_star6*/107701, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【魔法】後衛の防衛能力に秀でた、夏のドジっ娘メイド。\n味方全体に防御力アップと継続ＨＰ回復をかけ、\nさらに壁になるゴーレムを呼んで、戦線を支える。", /*only_disp_owned*/0, /*start_time*/"2021/07/15 15:00:00", /*end_time*/"2021/07/19 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/107801, /*unit_name*/"キャル（サマー）", /*kana*/"きゃる", /*prefab_id*/107801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/780, /*atk_type*/2, /*normal_atk_cast_time*/1.92, /*cutin_1*/107801, /*cutin_2*/0, /*cutin1_star6*/107801, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】後衛から強力な単体攻撃を放つ真夏の猫娘。\nスキルで敵の魔法防御力を下げた上で、\n敵単体への魔法攻撃を繰り出し、大ダメージを与える。", /*only_disp_owned*/0, /*start_time*/"2021/06/20 15:00:00", /*end_time*/"2021/06/24 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/107901, /*unit_name*/"タマキ（サマー）", /*kana*/"たまき", /*prefab_id*/107901, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/225, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/107901, /*cutin_2*/0, /*cutin1_star6*/107901, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】前衛で連続攻撃を放つ、海辺の気まぐれ猫娘。\nランダムな相手への単体攻撃を計４度行う\nユニオンバーストは、対象がランダムだが威力は抜群。", /*only_disp_owned*/0, /*start_time*/"2021/07/15 15:00:00", /*end_time*/"2021/07/19 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/108001, /*unit_name*/"ミフユ（サマー）", /*kana*/"みふゆ", /*prefab_id*/108001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/495, /*atk_type*/1, /*normal_atk_cast_time*/2.19, /*cutin_1*/108001, /*cutin_2*/0, /*cutin1_star6*/108001, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】中衛で、攻撃と補助の両方をこなす海の傭兵。\nユニオンバーストの効果で味方全体の物理攻撃力を高め、\n物理攻撃パーティの能力アップに一役買う。", /*only_disp_owned*/0, /*start_time*/"2020/07/20 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/108101, /*unit_name*/"シノブ（ハロウィン）", /*kana*/"しのぶ", /*prefab_id*/108101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/440, /*atk_type*/1, /*normal_atk_cast_time*/1.55, /*cutin_1*/108101, /*cutin_2*/0, /*cutin1_star6*/108101, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】中衛で、弱った敵を刈り取る幻夜の霊能少女。\n弱った敵単体に大ダメージを与えるユニオンバーストは\n対象を撃破時さらに敵全体に追加ダメージを与える。", /*only_disp_owned*/0, /*start_time*/"2021/09/24 12:00:00", /*end_time*/"2021/09/30 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/108201, /*unit_name*/"ミヤコ（ハロウィン）", /*kana*/"みやこ", /*prefab_id*/108201, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/590, /*atk_type*/1, /*normal_atk_cast_time*/2.42, /*cutin_1*/108201, /*cutin_2*/0, /*cutin1_star6*/108201, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】中衛から、敵陣の後方を狙い撃つ幽霊狼少女。\n前方の相手を無視して妨害スキルやユニオンバーストを\n敵後方に放ち、特に防御力が低いキャラの脅威になる。", /*only_disp_owned*/0, /*start_time*/"2020/09/23 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/108301, /*unit_name*/"ミサキ（ハロウィン）", /*kana*/"みさき", /*prefab_id*/108301, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/815, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/108301, /*cutin_2*/0, /*cutin1_star6*/108301, /*cutin2_star6*/0, /*guild_id*/15, /*exskill_display*/0, /*comment*/"【魔法】後衛で、妨害スキルを操るオシャレ魔法少女。\n相手を誘惑状態にするスキルや、複数の状態異常を\n同時に付与するユニオンバーストで相手をかく乱する。", /*only_disp_owned*/0, /*start_time*/"2021/09/24 12:00:00", /*end_time*/"2021/09/30 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/108401, /*unit_name*/"チカ（クリスマス）", /*kana*/"ちか", /*prefab_id*/108401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/770, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/108401, /*cutin_2*/0, /*cutin1_star6*/108401, /*cutin2_star6*/0, /*guild_id*/10, /*exskill_display*/0, /*comment*/"【魔法】後衛で、精霊を唱喚して戦う雪華の歌姫。\nユニオンバーストで呼び出す精霊たちはＨＰやＴＰを\n回復する能力を持ち、不利な戦況をも一変させる。", /*only_disp_owned*/0, /*start_time*/"2021/11/24 12:00:00", /*end_time*/"2021/11/30 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/108501, /*unit_name*/"クルミ（クリスマス）", /*kana*/"くるみ", /*prefab_id*/108501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/295, /*atk_type*/1, /*normal_atk_cast_time*/1.55, /*cutin_1*/108501, /*cutin_2*/0, /*cutin1_star6*/108501, /*cutin2_star6*/0, /*guild_id*/15, /*exskill_display*/0, /*comment*/"【物理】前衛から、ベルの音色で味方を守る小さな女優。\n攻撃を受けるまで周囲にいる味方の防御力を大きく高める\nスキルを持つ。活用できれば無類の耐久力を誇る。", /*only_disp_owned*/0, /*start_time*/"2020/11/24 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/108601, /*unit_name*/"アヤネ（クリスマス）", /*kana*/"あやね", /*prefab_id*/108601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/190, /*atk_type*/1, /*normal_atk_cast_time*/1.425, /*cutin_1*/108601, /*cutin_2*/0, /*cutin1_star6*/108601, /*cutin2_star6*/0, /*guild_id*/10, /*exskill_display*/0, /*comment*/"【物理】前衛で、敵をなぎ倒していく聖夜のくまっ子。\nユニオンバーストはＨＰを消費するが威力は絶大。\nスキルで物理攻撃力を上げ、さらにダメージアップ。", /*only_disp_owned*/0, /*start_time*/"2021/11/24 12:00:00", /*end_time*/"2021/11/30 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/108701, /*unit_name*/"ヒヨリ（ニューイヤー）", /*kana*/"ひより", /*prefab_id*/108701, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/170, /*atk_type*/1, /*normal_atk_cast_time*/2.17, /*cutin_1*/108701, /*cutin_2*/0, /*cutin1_star6*/108701, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】前衛で、物理火力を担う、振り袖姿の元気娘。\n物理攻撃キャラの攻撃力を上昇させるスキルを使う。\nさらに高い威力の単体ユニオンバーストの攻撃力は随一。", /*only_disp_owned*/0, /*start_time*/"2021/01/17 12:00:00", /*end_time*/"2021/01/22 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/108801, /*unit_name*/"ユイ（ニューイヤー）", /*kana*/"ゆい", /*prefab_id*/108801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/21, /*se_type*/7, /*move_speed*/450, /*search_area_width*/745, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/108801, /*cutin_2*/0, /*cutin1_star6*/108801, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【魔法】後衛の、補助魔法に特化した、晴れ姿の癒し手。\n自身の攻撃力と引き換えに強力なバリアと継続回復状態を\n味方全体に付与する。絶大な防御能力は他を圧倒する。", /*only_disp_owned*/0, /*start_time*/"2021/01/17 12:00:00", /*end_time*/"2021/01/22 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/108901, /*unit_name*/"レイ（ニューイヤー）", /*kana*/"れい", /*prefab_id*/108901, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/22, /*se_type*/4, /*move_speed*/450, /*search_area_width*/153, /*atk_type*/1, /*normal_atk_cast_time*/2.215, /*cutin_1*/108901, /*cutin_2*/0, /*cutin1_star6*/108901, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】前衛で、魔法攻撃から味方を守る、華麗な剣士。\nスキルで範囲内の味方に魔法無効バリアを展開し、\nさらにユニオンバーストで敵をスタンさせ攻撃を断つ。", /*only_disp_owned*/0, /*start_time*/"2020/12/22 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/109001, /*unit_name*/"エリコ（バレンタイン）", /*kana*/"えりこ", /*prefab_id*/109001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/187, /*atk_type*/1, /*normal_atk_cast_time*/1.9, /*cutin_1*/109001, /*cutin_2*/0, /*cutin1_star6*/109001, /*cutin2_star6*/0, /*guild_id*/11, /*exskill_display*/0, /*comment*/"【物理】前衛で、ピンチをチャンスに変える愛の壊し屋。\nスキルはＨＰを消費し、自身の攻撃力を高める。また、\nユニオンバーストはＨＰが低いほど超絶威力を発揮する。", /*only_disp_owned*/0, /*start_time*/"2021/01/25 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/109101, /*unit_name*/"シズル（バレンタイン）", /*kana*/"しずる", /*prefab_id*/109101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/385, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/109101, /*cutin_2*/0, /*cutin1_star6*/109101, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】中衛で皆を助けるパティシエールのお姉ちゃん。\n複数のパラメータが同時に上昇するフィールドを展開し、\nさらに効果時間中はスキル効果が大幅に強化される。", /*only_disp_owned*/0, /*start_time*/"2021/02/10 12:00:00", /*end_time*/"2021/02/15 22:59:59", /*original_unit_id*/0);
