INSERT INTO `unit_data` VALUES (/*unit_id*/110301, /*unit_name*/"サレン（サマー）", /*kana*/"されん", /*prefab_id*/110301, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/585, /*atk_type*/1, /*normal_atk_cast_time*/2.24, /*cutin_1*/110301, /*cutin_2*/0, /*cutin1_star6*/110301, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】中衛で、味方の速攻を支える海辺のサレンママ。\nバトル開始時に味方全体のＴＰを一気に溜めることで、\n迅速にユニオンバーストを発動させることを可能にする。", /*only_disp_owned*/0, /*start_time*/"2021/06/16 15:00:00", /*end_time*/"2021/06/20 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/110401, /*unit_name*/"マコト（サマー）", /*kana*/"まこと", /*prefab_id*/110401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/180, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/110401, /*cutin_2*/0, /*cutin1_star6*/110401, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】前衛で攻撃対象が１つの敵に特化した海の狼娘。\n攻撃対象が１つの場合、スキルとユニオンバーストともに\n真価を発揮し他を圧倒する絶大な破壊力で敵をなぎ払う。", /*only_disp_owned*/0, /*start_time*/"2021/07/19 15:00:00", /*end_time*/"2021/07/24 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/110501, /*unit_name*/"カオリ（サマー）", /*kana*/"かおり", /*prefab_id*/110501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/425, /*atk_type*/1, /*normal_atk_cast_time*/2.42, /*cutin_1*/110501, /*cutin_2*/0, /*cutin1_star6*/110501, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】中衛で、敵をまとめてなぎ倒す、真夏の南国娘。\n吹き飛ばし効果を持つスキルで敵をまとめ、攻撃対象が\n多い程、威力が増すユニオンバーストで敵をなぎ倒す。", /*only_disp_owned*/0, /*start_time*/"2021/06/18 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/110601, /*unit_name*/"マホ（サマー）", /*kana*/"まほ", /*prefab_id*/110601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/792, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/110601, /*cutin_2*/0, /*cutin1_star6*/110601, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【魔法】後衛で、膨大な魔力を振るう、真夏のおとぎ姫。\n高火力で対象がランダムなスキルやユニオンバーストは、\n攻撃対象が１つの敵に対して絶大なダメージを叩き出す。", /*only_disp_owned*/0, /*start_time*/"2021/09/24 12:00:00", /*end_time*/"2021/09/30 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/110701, /*unit_name*/"アオイ（編入生）", /*kana*/"あおい", /*prefab_id*/110701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/680, /*atk_type*/1, /*normal_atk_cast_time*/1.82, /*cutin_1*/110701, /*cutin_2*/0, /*cutin1_star6*/110701, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】後衛で毒を操る、ぼっちエルフの編入生。\n敵が毒や猛毒になっていると強化される攻撃スキルと、\n敵の物理防御力を下げるスキルで味方をサポートする。", /*only_disp_owned*/0, /*start_time*/"2019/09/03 21:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/110801, /*unit_name*/"クロエ", /*kana*/"くろえ", /*prefab_id*/110801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/185, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/110801, /*cutin_2*/0, /*cutin1_star6*/110801, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で、手数で圧倒する、ダウナー系エルフ。\n攻撃するたびに相手に【畏縮】ステータスを追加し、\nスキルのダメージと物理防御力ダウンに磨きをかける。", /*only_disp_owned*/0, /*start_time*/"2019/09/16 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/110901, /*unit_name*/"チエル", /*kana*/"ちえる", /*prefab_id*/110901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/222, /*atk_type*/1, /*normal_atk_cast_time*/2.295, /*cutin_1*/110901, /*cutin_2*/0, /*cutin1_star6*/110901, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛でパンチを放つちぇる盛りＭＡＸな女の子。\nクリティカルを出すたびに【ちぇる】を溜め、自己を強化\nし続け、後半になるほど敵をちぇるっとじぇのさいする。", /*only_disp_owned*/0, /*start_time*/"2020/04/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/111001, /*unit_name*/"ユニ", /*kana*/"ゆに", /*prefab_id*/111001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/26, /*se_type*/7, /*move_speed*/450, /*search_area_width*/807, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/111001, /*cutin_2*/0, /*cutin1_star6*/111001, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【魔法】後衛で、味方の支援に特化した象牙の塔の才媛。\n自身の攻撃力は低いが、物理攻撃力の高い味方を強化し\n更に味方全体を魔法無効バリアで護りつつ勝利へ導く。", /*only_disp_owned*/0, /*start_time*/"2020/03/31 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/111101, /*unit_name*/"キョウカ（ハロウィン）", /*kana*/"きょうか", /*prefab_id*/111101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/820, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/111101, /*cutin_2*/0, /*cutin1_star6*/111101, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【魔法】後衛で味方の火力を高める、黒猫仮装の優等生。\n自分の魔法攻撃力に応じて効果が強化されるものと、\n効果が累積するもの等、多彩なスキルで攻撃力を高める。", /*only_disp_owned*/0, /*start_time*/"2021/10/22 12:00:00", /*end_time*/"2021/10/31 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/111201, /*unit_name*/"ミソギ（ハロウィン）", /*kana*/"みそぎ", /*prefab_id*/111201, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/212, /*atk_type*/1, /*normal_atk_cast_time*/2.17, /*cutin_1*/111201, /*cutin_2*/0, /*cutin1_star6*/111201, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】前衛で範囲攻撃を放つ、カボチャ衣装の悪戯娘。敵に５カウントで爆発する爆弾を仕掛けたり、カボチャの手榴弾を投げつけたりと、様々な範囲攻撃で敵を弄ぶ。", /*only_disp_owned*/0, /*start_time*/"2021/08/16 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/111301, /*unit_name*/"ミミ（ハロウィン）", /*kana*/"みみ", /*prefab_id*/111301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/365, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/111301, /*cutin_2*/0, /*cutin1_star6*/111301, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】中衛の、攻撃に特化した、ぐるぐるうさぎっこ。\n行動頻度は少ないが、高威力の範囲攻撃を放ち、\n味方全体の物理攻撃力を大きく高めるスキルも効果抜群。", /*only_disp_owned*/0, /*start_time*/"2019/10/16 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/111401, /*unit_name*/"ルナ", /*kana*/"るな", /*prefab_id*/111401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/25, /*se_type*/7, /*move_speed*/450, /*search_area_width*/765, /*atk_type*/2, /*normal_atk_cast_time*/1.87, /*cutin_1*/111401, /*cutin_2*/0, /*cutin1_star6*/111401, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛で、死霊術でおともだちを作る可憐な少女。\nルナがダメージを与える度に集まってくるおともだちを、\n各スキルで消費する。消費数に応じ強大な力を発揮する。", /*only_disp_owned*/0, /*start_time*/"2019/10/31 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/111501, /*unit_name*/"クリスティーナ（クリスマス）", /*kana*/"くりすてぃーな", /*prefab_id*/111501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/10, /*se_type*/4, /*move_speed*/450, /*search_area_width*/265, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/111501, /*cutin_2*/0, /*cutin1_star6*/111501, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】前衛で戦いを愉しむ、聖夜の『誓約女君』。\nユニオンバーストを使用すると得られるコインの有無で、\n補助と攻撃の二役を切り替え、華麗に敵を斬り倒す。", /*only_disp_owned*/0, /*start_time*/"2020/12/10 12:00:00", /*end_time*/"2020/12/21 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/111601, /*unit_name*/"ノゾミ（クリスマス）", /*kana*/"のぞみ", /*prefab_id*/111601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/418, /*atk_type*/1, /*normal_atk_cast_time*/2.24, /*cutin_1*/111601, /*cutin_2*/0, /*cutin1_star6*/111601, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】中衛でパーティの守りを支えるサンタアイドル。\nスキルで物理攻撃を無効化し、後方の味方が多いほど\n物理防御力を高めるユニオンバーストで生存力を高める。", /*only_disp_owned*/0, /*start_time*/"2021/10/19 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/111701, /*unit_name*/"イリヤ（クリスマス）", /*kana*/"いりや", /*prefab_id*/111701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/255, /*atk_type*/2, /*normal_atk_cast_time*/1.3, /*cutin_1*/111701, /*cutin_2*/0, /*cutin1_star6*/111701, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【魔法】前衛で、血を対価に敵を攻撃する聖夜の吸血鬼。\n残りＨＰが低い程ダメージが上昇するスキルと、ＨＰを\n消費するスキルを組み合わせ、絶大な破壊力を発揮する。", /*only_disp_owned*/0, /*start_time*/"2019/12/20 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/111801, /*unit_name*/"ペコリーヌ（ニューイヤー）", /*kana*/"ぺこりーぬ", /*prefab_id*/111801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/22, /*se_type*/4, /*move_speed*/450, /*search_area_width*/248, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/111801, /*cutin_2*/0, /*cutin1_star6*/111801, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】前衛で元気いっぱいに新年を祝う腹ペコお姫様。\n物理攻撃力を高めるスキルで味方を強化し、ＨＰが多い\nほどダメージが上昇するユニオンバーストで敵を討つ。", /*only_disp_owned*/0, /*start_time*/"2021/07/24 15:00:00", /*end_time*/"2021/07/31 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/111901, /*unit_name*/"コッコロ（ニューイヤー）", /*kana*/"こっころ", /*prefab_id*/111901, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/23, /*se_type*/7, /*move_speed*/450, /*search_area_width*/159, /*atk_type*/1, /*normal_atk_cast_time*/1.87, /*cutin_1*/111901, /*cutin_2*/0, /*cutin1_star6*/111901, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】前衛で、味方の補助に秀でた、新風の巫女。\n物理クリティカル時のダメージアップのスキルで味方の\n殲滅力を高めつつ、挑発や継続回復で耐久面を支える。", /*only_disp_owned*/0, /*start_time*/"2021/01/12 12:00:00", /*end_time*/"2021/01/17 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/112001, /*unit_name*/"キャル（ニューイヤー）", /*kana*/"きゃる", /*prefab_id*/112001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/21, /*se_type*/7, /*move_speed*/450, /*search_area_width*/690, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/112001, /*cutin_2*/0, /*cutin1_star6*/112001, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【魔法】後衛で、攻防双方で活躍する晴れ着姿の猫娘。\n与ダメージに応じて魔法攻撃力がアップするユニオン\nバーストで、高いベースの攻撃力がさらに強大になる。", /*only_disp_owned*/0, /*start_time*/"2021/01/12 12:00:00", /*end_time*/"2021/01/17 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/112101, /*unit_name*/"スズメ（ニューイヤー）", /*kana*/"すずめ", /*prefab_id*/112101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/21, /*se_type*/7, /*move_speed*/450, /*search_area_width*/722, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/112101, /*cutin_2*/0, /*cutin1_star6*/112101, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】後衛で祈りによるサポートを行うドジっ娘巫女。\nスキルの魔法無効バリアで耐久力を高め、ユニオン\nバーストでＨＰ回復と行動速度アップで戦況を整える。", /*only_disp_owned*/0, /*start_time*/"2021/11/16 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/112201, /*unit_name*/"カスミ（マジカル）", /*kana*/"かすみ", /*prefab_id*/112201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/730, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/112201, /*cutin_2*/0, /*cutin1_star6*/112201, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛の、妨害に特化した能力を持つ魔法探偵。\n相手のＴＰを大きく減少させるスキルや、遠くの敵を\n束縛するスキルを操り、相手の連携を大きく乱す。", /*only_disp_owned*/0, /*start_time*/"2020/01/31 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/112301, /*unit_name*/"シオリ（マジカル）", /*kana*/"しおり", /*prefab_id*/112301, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/712, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/112301, /*cutin_2*/0, /*cutin1_star6*/112301, /*cutin2_star6*/0, /*guild_id*/5, /*exskill_display*/0, /*comment*/"【物理】後衛で味方の火力の底上げを担う魔法狩人。\nユニオンバーストで味方全体の物理攻撃力を大きく高め\nスキルは範囲内の物理攻撃力を高め、輝矢の一撃を放つ。", /*only_disp_owned*/1, /*start_time*/"2020/01/31 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/112401, /*unit_name*/"ウヅキ（デレマス）", /*kana*/"うづき", /*prefab_id*/112401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/370, /*atk_type*/1, /*normal_atk_cast_time*/2.24, /*cutin_1*/112401, /*cutin_2*/0, /*cutin1_star6*/112401, /*cutin2_star6*/0, /*guild_id*/18, /*exskill_display*/0, /*comment*/"【物理】中衛で、味方を鼓舞して戦う、キュートな少女。\n味方をＴＰや攻撃力をアップさせるスキルでサポートし、\n自身も強力な範囲攻撃で敵をなぎ払う。", /*only_disp_owned*/0, /*start_time*/"2021/03/08 12:00:00", /*end_time*/"2021/03/24 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/112501, /*unit_name*/"リン（デレマス）", /*kana*/"りんでれます", /*prefab_id*/112501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/153, /*atk_type*/1, /*normal_atk_cast_time*/2.215, /*cutin_1*/112501, /*cutin_2*/0, /*cutin1_star6*/112501, /*cutin2_star6*/0, /*guild_id*/18, /*exskill_display*/0, /*comment*/"【物理】前衛で、氷を創出し味方を護る、クールな少女。\n目の前の敵を束縛するスキルや挑発で行動を妨害し、\n自身にもバリアを展開し、鉄壁の防御能力を発揮する。", /*only_disp_owned*/0, /*start_time*/"2021/03/08 12:00:00", /*end_time*/"2021/03/24 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/112601, /*unit_name*/"ミオ（デレマス）", /*kana*/"みお", /*prefab_id*/112601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/695, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/112601, /*cutin_2*/0, /*cutin1_star6*/112601, /*cutin2_star6*/0, /*guild_id*/18, /*exskill_display*/0, /*comment*/"【魔法】後衛で攻防共に活躍するパッション溢れる少女。\nダメージを受けた味方中心に回復魔法で補助をし、\nさらに魔法攻撃を仕掛けて、敵を一網打尽にする。", /*only_disp_owned*/1, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/112701, /*unit_name*/"リン（レンジャー）", /*kana*/"りん", /*prefab_id*/112701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/422, /*atk_type*/1, /*normal_atk_cast_time*/2.19, /*cutin_1*/112701, /*cutin_2*/0, /*cutin1_star6*/112701, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】中衛から、敵の守りを貫くドングリレンジャー。\n戦闘開始と共に範囲内の敵の物理防御力を大幅に下げ、\n序盤から大ダメージを与えられる戦況を作り出す。", /*only_disp_owned*/0, /*start_time*/"2020/04/30 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
