INSERT INTO `unit_data` VALUES (/*unit_id*/112901, /*unit_name*/"リノ（ワンダー）", /*kana*/"りの", /*prefab_id*/112901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/730, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/112901, /*cutin_2*/0, /*cutin1_star6*/112901, /*cutin2_star6*/0, /*guild_id*/6, /*exskill_display*/0, /*comment*/"【物理】後衛で、希望の力で戦う、不思議の国の救世主。\nクリティカルすると効果アップのスキルや味方の数が多い\n程、威力がアップするユニオンバーストで敵を殲滅する。", /*only_disp_owned*/0, /*start_time*/"2020/06/03 19:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/113001, /*unit_name*/"アユミ（ワンダー）", /*kana*/"あゆみ", /*prefab_id*/113001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/508, /*atk_type*/1, /*normal_atk_cast_time*/2.34, /*cutin_1*/113001, /*cutin_2*/0, /*cutin1_star6*/113001, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】中衛で、戦場の動向を自在に操る白兎の乙女。\n敵の行動速度をダウンさせ、味方の速度をアップさせる\nスキルと敵の時を止めるスキルで、常に味方を支える。", /*only_disp_owned*/1, /*start_time*/"2020/05/31 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
